import Poll from '../components/Poll'
import CreatePoll from '../components/CreatePoll'
const PollPage = ({match,getPoll}) => {
    getPoll(match.params.id)

    return (
        <div>
            <CreatePoll/>
        </div>
    )
}

export default PollPage
